ter att skickas till PayPal, inklusive information som krävs för att behandla eller ge support för betalningen, såsom köpets totalsumma och faktureringsinformation.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Se <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPals integritetspolicy</a> för mer detaljer.','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Ta emot betalningar personligen via BACS. Mer känt som banköverföring.','%s field'=>'Fältet %s','%s page'=>'Sidan %s','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'I den här undersektionen bör du lista vilka tredjeparts-betalväxlar du använder för att ta emot betalningar i din butik, eftersom dessa antagligen hanterar kunduppgifter. Vi har tagit med PayPal som ett exempel, men du bör ta bort detta om du inte använder PayPal.','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'I den här sektionen bör du lista vem du delar uppgifter med och för vilket syfte. Detta kan innefatta, men inte vara begränsat till, analys, marknadsföring, betalningslösningar, fraktbolag och tredjeparts-inbäddningar.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Vi delar information med tredje part som hjälper oss genomföra beställningar och lagra tjänster åt dig, till exempel --','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Medlemmar i vårt team har tillgång till informationen du ger oss. Till exempel, både administratörer och butiksägare har tillgång till:','Customer information like your name, email address, and billing and shipping information.'=>'Kundinformation såsom ditt namn, e-postadress samt fakturerings- och leveransinformation.','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Vårt team har tillgång till denna information för att uppfylla beställningar, genomföra återbetalningar och tillhandahålla support.','We will also store comments or reviews, if you choose to leave them.'=>'Vi lagrar även kommentarer eller recensioner, om du lämnar dessa.','What we share with others'=>'Vad vi delar med andra','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Beställningsinformation som t.ex. vad som köptes, när det köptes och var det ska skickas, samt','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Generellt lagrar vi bara information om dig så länge vi behöver informationen för de ändamål vilka vi samlar in och använder den, och så länge vi inte är juridiskt skyldiga att lagra den. Till exempel kommer vi att lagra beställningsinformation för gällande tidsperiod för skatte- och redovisningsändamål. Detta inkluderar ditt namn, e-postadress och fakturerings- och leveransadresser.','Who on our team has access'=>'Vem i vårt team har åtkomst','Improve our store offerings'=>'Förbättra vår butikserbjudanden','Process payments and prevent fraud'=>'Behandla betalningar och förhindra bedrägerier','Send you marketing messages, if you choose to receive them'=>'Skicka dig marknadsföringsmeddelanden, om du väljer att ta emot dem','Set up your