g beställningen!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Platsinformation, IP-adress och webbläsartyp: vi använder detta för ändamål såsom momsberäkning och fraktkostnader','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Produkter som du har visat: vi använder detta för att exempelvis visa dig produkter som du nyligen har tittat på.','We collect information about you during the checkout process on our store.'=>'Vi samlar in information om dig under kassaprocessen i vår butik.','What we collect and store'=>'Vad vi samlar in och lagrar','While you visit our site, we’ll track:'=>'Medan du besöker vår webbplats, kommer vi att spåra:','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Detta provspråk omfattar grunderna kring vilka personuppgifter som din butik samlar in, lagrar och delar, samt vilka som kan få tillgång till dessa uppgifter. Beroende på vilka inställningar som är aktiverade och vilka andra tillägg som används, varierar den specifika information som delas av din butik. Vi rekommenderar att rådfråga en advokat när du bestämmer vilken information som ska omfattas och beskrivas i din integritetspolicy.','Browser User Agent'=>'Webbläsaranvändaragent','Items Purchased'=>'Köpta produkter','Access granted'=>'Åtkomst beviljad','Download count'=>'Nedladdningsräknare','User email'=>'Användarens e-post','Payment Tokens'=>'Betalnings-tokens','Token'=>'Token','Order Number'=>'Beställningsnummer','Personal data removed.'=>'Personuppgifter har tagits bort.','Shipping Postal/Zip Code'=>'Postnummer för lev